import React from "react";

export default function PreferidosPerfil() {
  return (
    <div className="card" style={{ maxWidth: 900, margin: "40px auto" }}>
      <h2>Perfil Preferido</h2>
      <p>Detalles del perfil preferido</p>
    </div>
  );
}
